aquisição de sulfato de alumínio ferroso líquido. VALOR ESTIMADO: R$ 32.100.000,00;
DOTAÇÃO ORÇAMENTÁRIA: UO: 22.202; PROGRAMA DE TRABALHO/ NATUREZA DE DESPESA: 17.122.6004.8517/6977; FONTE DE RECURSO: Recursos Próprios, CÓDIGO: 11.101.000.000-3. PRAZO DE ENTREGA: 05 dias consecutivos. VIGÊNCIA: 365 dias consecutivos. DATA FINAL PARA RECEBIMENTO DAS PROPOSTAS: 16/03/2016, às 08:30 horas. INÍCIO DA SESSÃO DE DISPUTA: 16/03/2016, às 09:00 horas. O edital e seus anexos poderão ser encontrados no site: www.licitacoes-e.com.br (ID:620410) a partir do dia 02/03/2016 . Fone: (61) 3213-7575, e-mail: licitacao@caesb.df.gov.br. A Sessão Pública será realizada no portal do Licitacoes-e. Em atendimento à Lei Distrital nº 5.453/2015, as informações referentes ao certame também estão disponíveis no site www.caesb.df.gov.br - menu Licitações. Bras nan nan AQUISIÇÃO (OUTROS)

